  <body>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Rate by Run</h1>
    </div>
    <svg id="run" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      Run&nbsp;<sub>min</sub>:&nbsp;<input id="runXMin"/>;
      Run&nbsp;<sub>max</sub>:&nbsp;<input id="runXMax"/>;
      Rate&nbsp;<sub>min</sub>:&nbsp;<input id="runYMin"/>;
      Rate&nbsp;<sub>max</sub>:&nbsp;<input id="runYMax"/>;
      <button onclick="applyRunDomains()">Apply</button>
      <button onclick="resetRunDomains()">Reset</button>
    </div>
    <script>
      var runData = [{"color": "#c0c0c0", "values": [{"y": 49179.518941900853, "x": 1000}, {"y": 68077.717429697441, "x": 1400}, {"y": 96096.329499783809, "x": 2000}, {"y": 185544.43815698527, "x": 4000}, {"y": 387881.84026744467, "x": 8900}], "key": "Sending"}, {"color": "#000000", "values": [{"y": 49179.494202277441, "x": 1000}, {"y": 68077.741155650045, "x": 1400}, {"y": 96096.220925881455, "x": 2000}, {"y": 185544.63111748296, "x": 4000}, {"y": 387882.04466367041, "x": 8900}], "key": "Receiving"}]

      var runChart
      var runXMin = document.getElementById("runXMin"),
          runXMax = document.getElementById("runXMax"),
          runYMin = document.getElementById("runYMin"),
          runYMax = document.getElementById("runYMax")

      var applyRunDomains = function() {
        runChart.xDomain([runXMin.value, runXMax.value])
        runChart.yDomain([runYMin.value, runYMax.value])
        runChart.update()
      }

      var resetRunDomains = function() {
        runChart.xDomain(null)
        runChart.yDomain(null)
        runChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#run')
          runChart = nv.models.lineChart()
          runChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = runChart.xAxis.domain(),
                  yDomain = runChart.yAxis.domain()
              runXMin.value = xDomain[0]
              runXMax.value = xDomain[1]
              runYMin.value = yDomain[0]
              runYMax.value = yDomain[1]
            })

          runChart.xAxis
            .axisLabel("Run")
            .showMaxMin(false)

          runChart.yAxis
            .axisLabel("Rate, QpS")
            .showMaxMin(false)

          svg.datum(runData).call(runChart)

          return runChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#run')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

<div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Receiving vs Sending</h1>
    </div>
    <svg id="rate" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      Sending&nbsp;<sub>min</sub>:&nbsp;<input id="rateXMin"/>;

      <button onclick="applyRateDomains()">Apply</button>
      <button onclick="resetRateDomains()">Reset</button>
    </div>
    <script>
      var rateData = [{"color": "#c0c0c0", "values": [{"y": 49179.518941900853, "x": 49179.518941900853}, {"y": 68077.717429697441, "x": 68077.717429697441}, {"y": 96096.329499783809, "x": 96096.329499783809}, {"y": 185544.43815698527, "x": 185544.43815698527}, {"y": 387881.84026744467, "x": 387881.84026744467}], "key": "Reference"}, {"color": "#000000", "values": [{"y": 49179.494202277441, "x": 49179.518941900853}, {"y": 68077.741155650045, "x": 68077.717429697441}, {"y": 96096.220925881455, "x": 96096.329499783809}, {"y": 185544.63111748296, "x": 185544.43815698527}, {"y": 387882.04466367041, "x": 387881.84026744467}], "key": "Test UDP on 2 c4.xlarge"}]

      var rateChart
      var rateXMin = document.getElementById("rateXMin"),
          rateXMax = document.getElementById("rateXMax"),
          rateYMin = document.getElementById("rateYMin"),

      var applyRateDomains = function() {
        rateChart.xDomain([rateXMin.value, rateXMax.value])
        rateChart.yDomain([rateYMin.value, rateYMax.value])
        rateChart.update()
      }

      var resetRateDomains = function() {
        rateChart.xDomain(null)
        rateChart.yDomain(null)
        rateChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#rate')
          rateChart = nv.models.lineChart()
          rateChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = rateChart.xAxis.domain(),
                  yDomain = rateChart.yAxis.domain()
              rateXMin.value = xDomain[0]
              rateXMax.value = xDomain[1]
              rateYMin.value = yDomain[0]
              rateYMax.value = yDomain[1]
            })

          rateChart.xAxis
            .axisLabel("Sending, QpS")
            .showMaxMin(false)

          rateChart.yAxis
            .axisLabel("Receiving, QpS")
            .showMaxMin(false)

          svg.datum(rateData).call(rateChart)

          return rateChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#rate')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

<div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1>Queries Count</h1>
    </div>
    <svg id="counts" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">

                return d3.format(',.0f')(d/1000) + 'k'
              }

              if (d < 1000 && d > 0.999) {
                return d3.format(',.0f')(d)
              }

              if (d < 1 && d > 0.0999) {
                return  d3.format(',.1f')(d)
              }

              if (d < 0.1 && d > 0.00999) {
                return d3.format(',.2f')(d)
              }

              return d3.format(',.3f')(d)
            })
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.yAxis
            .axisLabel("count, %")
            .showMaxMin(false)

          svg.datum(latencyData).call(latencyChart)

          return latencyChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#latency')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#queue')
          queueChart = nv.models.lineWithFocusChart()

              var yDomain = queueChart.yAxis.domain()
              queueYMin.value = yDomain[0]
              queueYMax.value = yDomain[1]

          queueChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          queueChart.yAxis
            .axisLabel("count")
            .showMaxMin(false)

          svg.datum(queueData).call(queueChart)

          return queueChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#queue')
                graph.width(svg.attr('width'))
